import React, { useEffect, useState } from 'react';
import Destination from '../components/Destination';

function HomePageLoggedIn({ user }) {
    const [destinations, setDestinations] = useState([]);

    useEffect(() => {
        fetch('/destinations').then((r) => {
          if (r.ok) {
            r.json().then((destinations) => console.log(destinations));
          }
        });
      }, []);
  return (
    <div>
        <h1>Welcome, {user.username}</h1>
        <p>Explore our amazing travel options here.</p>
        <ul className="h-48 flex justify-around flex-wrap gap-4 pt-8 pb-8"></ul>
        {destinations.map((destination) => (
            <Destination
            key={destination.id}
            destination={destination} 
            />
        ))}
    </div>
  )
}

export default HomePageLoggedIn
